import React, { useState ,useEffect } from 'react';
import { Link, useHistory } from 'react-router-dom';
import { FiPower } from 'react-icons/fi';
import { FiUser } from 'react-icons/fi';

import api from '../../services/api';

import './styles.css';

import logoImg from '../../assets/Logo.png';

import { makeStyles } from '@material-ui/core/styles';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';
import IconButton from '@material-ui/core/IconButton';
import StarBorderIcon from '@material-ui/icons/StarBorder';

const useStyles = makeStyles((theme) => ({
    root: {
      display: 'flex',
      flexWrap: 'wrap',
      justifyContent: 'space-around',
      overflow: 'hidden',
      backgroundColor: theme.palette.background.paper,
    },
    gridList: {
      flexWrap: 'nowrap',
      // Promote the list into his own layer on Chrome. This cost memory but helps keeping high FPS.
      transform: 'translateZ(0)',
    },
    title: {
      color: '#00e0ff',
    },
    titleBar: {
      background:
        'linear-gradient(to top, rgba(0,0,0,0.7) 0%, rgba(0,0,0,0.3) 70%, rgba(0,0,0,0) 100%)',
    },
  }));
export default function ProjectPage()
{
    const [project,setProject] = useState({});
    const [images,setImages] = useState([]);
    const id = localStorage.getItem("projectID");
    const history = useHistory();

    const teamId = localStorage.getItem('teamId');
    const teamName = localStorage.getItem('teamName');

    const classes = useStyles();


    useEffect(() => {
        api.get('project', {
            headers: {
                id: id,
            }
        }).then(response => {
            setProject(response.data[0]);
          
        })
    }, []);
    useEffect(() => {
        api.get('images', {
            headers: {
                id: id,
            }
        }).then(response => {
            setImages(response.data);
          
        })
    }, []);

    function handleLogout() {
        localStorage.clear();
        history.push('/');
    }

    function handleProfile() {
        if(teamId==null)
            history.push('/login');
        else
            history.push('/profile');
    }

    return(
        <div>
        <div className="header-container">
            <header>
                <Link id="btnHome" to="/">
                    <img src={logoImg} alt="Project Dawn" />
                </Link>
                <span>Bem vindo, {teamName}</span>

                <Link className="buttonHmCadastro" to="/projects/new">Cadastrar novo caso</Link>
                <button onClick={handleProfile} type="button">
                    <FiUser size={20} color="#00E0FF" />
                </button>

                <button onClick={handleLogout} type="button">
                    <FiPower size={20} color="#00E0FF" />
                </button>
            </header>
        </div>
      
        
            <div className="project-container">
                
                <div className="infos">
                    <div className="principal">
                        <p id="title">{project.title}</p>
                        <img id="imageLogo" src={project.url} alt="Logo do Projeto"></img>
                        <p id="description">{project.description}</p>
                    </div>
                    <div className="images">
                    <div className={classes.root}>
                        <GridList className={classes.gridList} cols={2.5}>
                            {images.map(tile => (
                            <GridListTile key={tile.key}>
                                <img src={tile.url} alt={tile.name} />
                                <GridListTileBar
                                title={tile.name}
                                classes={{
                                    root: classes.titleBar,
                                    title: classes.title,
                                }}
                                actionIcon={
                                    <IconButton aria-label={`star ${tile.name}`}>
                                    <StarBorderIcon className={classes.title} />
                                    </IconButton>
                                }
                                />
                            </GridListTile>
                            ))}
                        </GridList>
                        </div>
                    </div>
    

                </div>
                
               
            </div>
        </div>
    )
}
